import React, { useEffect } from 'react'
import { Routes, Route, Link } from 'react-router-dom'

const Produto = () => {
  useEffect(() => {
    const makeRequest = async () => {
      const data = await fetch('https://ranekapi.origamid.dev/json/api/produto')
        .then((res) => res.json())
        .then((json) => json)
    }
  }, [])

  return (
    <div>
      <nav>
        <Link to=''>Descrição</Link>
        <Link to='avaliacao'>Avaliação</Link>
        <Link to='customizado'>Customizado</Link>
      </nav>
      <Routes>{/* <Route path="" element={<ProdutoDescricao />} /> */}</Routes>
    </div>
  )
}

export default Produto
